script: |
  super -f text -I q1434.spq | sort > q1434.out

inputs:
  - name: q1434.spq
    data: |
      SELECT col2 + + col0 + - ( ( + col2 ) ) / - col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 33 >= ( col0 );
  - name: tab1

outputs:
  - name: q1434.out
    data: |
      145
      148
      160
